// import logo from './logo.svg';
import './App.css';
import Login from './Login'
import {BrowserRouter, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element = {<Login />}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
